	/**
	 * Returns all keywords of the grammar. This includes all literals for boolean and
	 * enumeration terminals.
	 */
	public java.util.Set<String> getKeywords() {
		if (this.keywords == null) {
			this.keywords = new java.util.LinkedHashSet<String>();
			for (genericity.language.gbind.grammar.GbindRule rule : RULES) {
				findKeywords(rule, this.keywords);
			}
		}
		return keywords;
	}
	
	/**
	 * Finds all keywords in the given element and its children and adds them to the
	 * set. This includes all literals for boolean and enumeration terminals.
	 */
	private void findKeywords(genericity.language.gbind.grammar.GbindSyntaxElement element, java.util.Set<String> keywords) {
		if (element instanceof genericity.language.gbind.grammar.GbindKeyword) {
			keywords.add(((genericity.language.gbind.grammar.GbindKeyword) element).getValue());
		} else if (element instanceof genericity.language.gbind.grammar.GbindBooleanTerminal) {
			keywords.add(((genericity.language.gbind.grammar.GbindBooleanTerminal) element).getTrueLiteral());
			keywords.add(((genericity.language.gbind.grammar.GbindBooleanTerminal) element).getFalseLiteral());
		} else if (element instanceof genericity.language.gbind.grammar.GbindEnumerationTerminal) {
			genericity.language.gbind.grammar.GbindEnumerationTerminal terminal = (genericity.language.gbind.grammar.GbindEnumerationTerminal) element;
			for (String key : terminal.getLiteralMapping().keySet()) {
				keywords.add(key);
			}
		}
		for (genericity.language.gbind.grammar.GbindSyntaxElement child : element.getChildren()) {
			findKeywords(child, this.keywords);
		}
	}
	
